import React from "react";

function Header() {
  return (
    <header>
      <h1>

        <span className="logo" role="img">
          <img src="https://danielarisa.com/wp-content/uploads/2022/08/download.png" alt="Pic" width="500" height="500"/>
        </span>
        <h4>We Got Some Real Good Stuff</h4>
      </h1>
    </header>
  );
}

export default Header;
